import React from 'react';
import { Line } from "react-chartjs-2";
import "./Defects.css"
import * as FaIcons from 'react-icons/fa'



import {
  LineChart_Defects, 
} from "variables/charts";


const Defects = ({LineChart_Defects_Example1}) => {
if(LineChart_Defects_Example1=="HourlyData"){
    var title = "Hourly";
}
if(LineChart_Defects_Example1=="DailyData"){
    var title = "Daily";
}
if(LineChart_Defects_Example1=="MonthlyData"){
    var title = "Monthly";
}
        return (
    <>

            <div className='Defects'>

                <div className='Defects-header'>
                  <FaIcons.FaChartArea className='Defects-icon' size={20} color={'white'}/>
                  <h3 className='Defects-title'>{title} Defect Rate Report</h3>
                </div>

              <div className="Defects-body">
                  <div className="Defects-chart">
                    <Line
                      data={LineChart_Defects[LineChart_Defects_Example1]}
                      options={LineChart_Defects.options}
                    />
                  </div>

              </div>
            </div>

     </>
        )

};

export default Defects;
